import React from "react";
import { Pie } from "react-chartjs-2";
function PieChart() {
  const data = {
    labels: ["Microsoft", "Accenture", "TCS", "Wipro"],
    datasets: [
      {
        data: [12, 83, 28, 51],
        backgroundColor: [
          "#FF6384",
          "#36A2EB",
          "#FFCE56",
          "#4CAF50",
          "#9C27B0",
        ],
        hoverBackgroundColor: [
          "#FF6384",
          "#36A2EB",
          "#FFCE56",
          "#4CAF50",
          "#9C27B0",
        ],
      },
    ],
  };
  return <Pie data={data} />;
}

export default PieChart;
